import json
import boto3
import base64


def lambda_handler(event, context):
	try:
		eventBody = json.loads(json.dumps(event))
		imageBase64 = eventBody['Image']
	except json.JSONDecodeError as e:
		return {
			'statusCode': 400,
			'body': json.dumps(event),
			'error': str(e)
		}
	
	# Amazon Textract client
	textract = boto3.client('textract')
	
	# Call Amazon Textract
	try:
		response = textract.analyze_expense(
			Document={
				'Bytes': base64.b64decode(imageBase64)
			})
		
		resp = response
	except Exception as e:
		return {
			'statusCode': 500,
			'body': json.dumps(event),
			'error': str(e)
		}
	try:
		
		expenses = resp['ExpenseDocuments']
		record_arr = []
		summary_arr = []
		
		for expense in expenses:
			summary_fields = expense['SummaryFields']
			line_item_groups = expense['LineItemGroups']
			for lig in line_item_groups:
				for li in lig['LineItems']:
					li_filt = {li_ef['Type']['Text']: li_ef['ValueDetection']['Text'] for li_ef in
						li['LineItemExpenseFields']}
					record_arr.append(li_filt)
				try:
					for s_f in summary_fields:
						summary_arr.append({s_f['Type']['Text']: s_f['ValueDetection']['Text']})
				except KeyError as e:
					summary_arr.append({
						'statusCode': 500,
						'body': json.dumps(summary_fields),
						'error': "Invalid Summary Fields" + str(e)
					})
	except KeyError as e:
		return {
			'statusCode': 500,
			'body': json.dumps(resp),
			'error': str(e)
		}
	
	return {
		'statusCode': 200,
		'body': json.dumps(record_arr)
	}
